import './App.css';
import GetAllAccounts from "./ApiAcount/GetAllAccounts";

function App() {
    const GetAccountByID =(userID = 0)=> {
        axios.get('http://localhost:8080/accounts/'+ userID)
            .then(res=> {
                console.log(res)
            }).catch(err => {
                console.log(err)
            })
    }

    const GetAllAccounts =()=> {
        axios.get('http://localhost:8080/accounts/')
            .then(res=> {
                console.log(res)
            }).catch(err => {
            console.log(err)
        })
    }

  return (
      <div>
          <button onClick={GetAllAccounts}>Get all users</button>
          <button onClick={GetAccountByID(1)}>Get user by ID</button>
      </div>
  );
}

export default App;
